import React from "react";
import "../Layout.css";
import aboutText from "../data/aboutText.json";

function About() {
  return (
    <div className="about-container">
      <div className="outer-card">
        <h1>Om Oss</h1>
        <div className="inner-card">
          {aboutText.paragraphs.map((item, index) => (
            <div
              key={index}
              style={{
                fontWeight: 600,
                wordWrap: "break-word",
                overflowWrap: "break-word",
                marginBottom: "16px",
              }}
            >
              <h2>{item.title}</h2>
              <p>{item.body}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default About;
